INSERT INTO `quotes` VALUES (1,'NO001','遗传变异在自然界中很显然是种常态而不是意外。','《基因传》'),(2,'NO002','物竞天择，适者生存。','达尔文'),(3,'NO003','生物体是基因创造的生存机器。生命短暂，基因不朽。','《自私的基因》'),(4,'NO004','比尔.盖茨曾断言：“ 下一个能够超越我的世界首富必定出自基因领域”。','《商业思维的速度》'),(5,'NO005','除了外伤,一切疾病都与基因有关。','利根川进'),(6,'NO007','圣人不治已病治未病，不治已乱治未乱。','《黄帝内经》'),(7,'NO008','上工治未病之病，中工治欲病之病，下工治已病之病。','(唐)孙思邈'),(8,'NO009','编码的“遗传程序”一代又一代的经过修饰并且编入历史信息，成为了一个强有力而又为人们熟悉的概念。','《生物学思想发展的历史》'),(9,'NO010','世上的一切生物，既非孤立生存，亦非只为自身生存。','(英国)布莱克.W.'),(10,'NO011','90年代的“人类基因组计划”使我们逐渐接近生命的核心奥妙：生命不仅是物理、化学的，生命还是数据的。','杨焕明院士'),(11,'NO012','我们以及其他一切动物都是各自基因创造的机器。','《自私的基因》'),(12,'NO013','真正的健康是暴露于病毒、细菌的危险之下，还依然健康。','《医学通识讲义》'),(13,'NO014','学会与疾病共存，因为真正健康，是包容疾病的。','《医学通识讲义》'),(14,'NO015','什么是基因？基因就是最能沉淀下来，最具可持续性，最具可复制性的东西。','《史蒂夫·乔布斯管理日志》'),(15,'NO016','遗传规律的精准不仅颠覆了我们的世界观，同时也成为人类征服自然界的强大武器。','威廉·贝特森'),(16,'NO017','究其根本，人类不过是携带基因的载体与表达功能的通路。','村上春树'),(17,'NO018','基因是自然界万物生长的源泉，而我们就像是风驰电掣的赛马，在转瞬间前仆后继薪火相传。','村上春树'),(18,'NO019','你的身体里流淌着祖先的血脉。','墨奈劳斯《奥德赛》'),(19,'NO020','你的生身父母，他们应负责任。尽管并非有意，但是事与愿违。他们把自身的缺憾全部赋予你。而你不甘寂寞，平添不少毛病。','菲利普·拉金'),(20,'NO021','就像研究物理和化学需要回归到分子与原子层面一样，我们需要通过生物科学手段来了解基因在大千世界中发挥的作用。','雨果·德·弗里斯'),(21,'NO022','改良环境和教育功在当下，而钙量的血统则利在千秋。','《遗传学》'),(22,'NO023','天性与特征将陪伴终生。','西班牙谚语'),(23,'NO024','我们是生存机器，但这里的“我们”并不单指人，它包括一切动物、植物、细菌和病毒。','《自私的基因》'),(24,'NO025','我们都是同一种复制基因--即人们称之为DNA的分子--的生存机器。','《自私的基因》'),(25,'NO026','音容笑貌源自传承：时移世变依然如旧，特征痕迹始终保留，任凭时光悄然离去，也无所谓斗转星移，一切终将无法忘记。','《遗传》'),(26,'NO027','我在研究中假设所有人类疾病都具有遗传性。','保罗·伯格'),(27,'NO028','新生儿在正式成人之前需要通过某些反应遗传天赋的测试。','弗朗西斯·克里克'),(28,'NO029','我怎么可能与犹太人有相似之处？我甚至都无法从自己身上找到共同点。','弗兰兹·卡夫卡'),(29,'NO030','分开抚养的双胞胎具有奇特的相似性。','《生来如此》'),(30,'NO031','反宿命论者认为DNA的重要性无足挂齿，但是每种人类疾病均源自DNA，而且（每种疾病）只能通过DNA才能治愈。','乔治·丘奇'),(31,'NO032','家族研究在经历了一个世纪的发展后终于建立起完整的谱系，而人们也逐渐打消了对于基因在解释全部人类差异时重要作用的质疑。','埃里克·特克海默');
/*!40000 ALTER TABLE `quotes` ENABLE KEYS */;
UNLOCK TABLES;

